!function(){"use strict";angular.module("app.controllers").controller("ContactCtrl",["$scope","$ionicLoading","$compile",function($scope,$ionicLoading,$compile){function initialize(){var myLatlng=new google.maps.LatLng(43.07493,-89.381388),mapOptions={center:myLatlng,zoom:16,mapTypeId:google.maps.MapTypeId.ROADMAP},map=new google.maps.Map(document.getElementById("map"),mapOptions),contentString="<div><a ng-click='clickTest()'>Click me!</a></div>",compiled=$compile(contentString)($scope),infowindow=new google.maps.InfoWindow({content:compiled[0]}),marker=new google.maps.Marker({position:myLatlng,map:map,title:"Uluru (Ayers Rock)"});google.maps.event.addListener(marker,"click",function(){infowindow.open(map,marker)}),$scope.map=map,console.log(map)}google.maps.event.addDomListener(window,"load",initialize),$scope.centerOnMe=function(){$scope.map&&($scope.loading=$ionicLoading.show({content:"Getting current location...",showBackdrop:!1}),navigator.geolocation.getCurrentPosition(function(pos){$scope.map.setCenter(new google.maps.LatLng(pos.coords.latitude,pos.coords.longitude)),$scope.loading.hide()},function(error){alert("Unable to get location: "+error.message)}))},$scope.clickTest=function(){alert("Example of infowindow with ng-click")}}])}();